import React, { Component } from 'react'
import { PushNotificationWorker } from '../serviceWorkerUtility'
export default class Home extends Component {
  async componentDidMount() {
    PushNotificationWorker.check()
    const swRegistration = PushNotificationWorker.registerServiceWorker()
    const permission = PushNotificationWorker.requestNotificationPermission()
    PushNotificationWorker.showLocalNotification('This is title', 'this is the message', swRegistration);
  }
  render() {
    return (
      <div>
        <h1>Home page</h1>
      </div>
    )
  }
}
